import logo from './img/logo.png';

function App() {
  return (
    <div className="App">
        <div className="header-container">
          <header className="App-header">
          <img src={logo} width={268} height={32}/>
          <nav>
              <button>Log in</button>
              <button>Sign in</button>
          </nav>
         </header>
        </div>
    </div>
  );
}

export default App;
